var User=function(r,s,e){this.name=r,this.imageURL=s,this.color=e,this.userID="id"+Math.random().toString(16).slice(2)},Users=function(){function r(){this.users=[]}return r.prototype.addUser=function(r){try{this.users.push(r)}catch(r){console.error(r)}},r.prototype.findUser=function(s){try{var r=this.users.find(function(r){return r.userID===s});if(r)return r}catch(r){console.error(r)}},r}(),users=new Users;module.exports={User:User,Users:Users,users:users};